import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // The provided HTML is missing the container divs for products,
    // preventing the page's own script from rendering them. We will inject
    // the necessary divs and re-run the initialization script. This assumes
    // the provided JS files are loaded along with the HTML.
    await page.evaluate(() => {
      const productsGrid = document.createElement('div');
      productsGrid.id = 'productsGrid';
      const junProductsGrid = document.createElement('div');
      junProductsGrid.id = 'junProductsGrid';
      document.body.appendChild(productsGrid);
      document.body.appendChild(junProductsGrid);

      if (typeof initializeWebsite === 'function') {
        initializeWebsite();
      }
    });

    // Take a screenshot to show that products have been loaded
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    // Locate the first "Add to Cart" button among the loaded products
    const addToCartButton = page.locator('.add-to-cart').first();
    await addToCartButton.waitFor({ state: 'visible', timeout: 5000 });

    // Click the button to add the product to the cart
    await addToCartButton.click();

    // Take a screenshot after clicking the button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_added.png'));

    // Verify the action by checking the application's internal cart state via evaluate
    const cartItemCount = await page.evaluate(() => {
      // The `cart` variable is defined globally by the provided data.js script
      if (typeof cart !== 'undefined') {
        return cart.reduce((sum, item) => sum + item.quantity, 0);
      }
      return -1; // Return an indicator that the cart variable was not found
    });

    return {
      success: true,
      action: "Added the first product to the cart after dynamically loading product elements.",
      extractedData: {
        cartItemCount: cartItemCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
